query ArticleTemplate(
  $slug: String!
) {
  strapiArticles(slug: {eq: $slug}) {
    title
    content
    author {
      id
      username
    }
  }
}

query UserTemplate(
  $id: String!
) {
  strapiUsers(id: {eq: $id}) {
    id
    username
    article {
      id
      title
      shortdesc
      slug
    }
  }
}

query PageTemplate(
  $slug: String!
) {
  strapiPages(slug: {eq: $slug}) {
    id
    Title
    Content
    slug
    subPages {
      id
      Title
      Content
      slug
    }
    parentPage {
      id
      Title
      slug
    }
  }
}

query PagesQuery {
  allStrapiPages {
    edges {
      node {
        id
        Title
        slug
        subPages {
          id
          Title
          Content
          slug
        }
      }
    }
  }
}

query IndexQuery {
  allStrapiArticles {
    edges {
      node {
        id
        slug
        title
        shortdesc
        date
        content
        author {
          id
          username
        }
      }
    }
  }
}
